const handleSubmit = async (e) => {
  e.preventDefault();

  const { data, error } = await supabase.from('treatments').insert([
    { patient_name: patientName, practitioner, date, treatment, location, memo },
  ]);

  if (error) {
    alert('エラーが発生しました：' + error.message);
  } else {
    console.log('登録されたデータ:', data); // ここで利用
    alert('施術情報を登録しました！');
    setPatientName('');
    setPractitioner('');
    setDate('');
    setTreatment('');
    setLocation('');
    setMemo('');
  }
};
